import React from "react"
import saveWellInfoToReduxStore from "../ActionCreators/saveWellInfoToReduxStore"
// react-bootstrap
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Dropdown from 'react-bootstrap/Dropdown';


const Home = () => {
    return (
      <Col md={4}>
        <h3 className="my-4"> Add New Well Data</h3>
        <Form.Control className="mt-3" placeholder="Operator" onChange={e => e.target.value}/>
        <Form.Control className="mt-3" placeholder="Rig" onChange={e => e.target.value}/>
        <Form.Control className="mt-3" placeholder="Well" onChange={e => e.target.value}/>
        <Form.Control className="mt-3" placeholder="County" onChange={e => e.target.value}/>
        <Form.Control className="mt-3" placeholder="State" onChange={e => e.target.value}/>
        <Form.Control className="mt-3" placeholder="Northing" onChange={e => e.target.value}/>
        <Form.Control className="mt-3" placeholder="Easting" onChange={e => e.target.value}/>
        <Button variant="primary">Create New Well</Button>
      </Col>

    )

}

export default Home
